import React from "react";
import { Grid, TextField } from "@material-ui/core";

export const TextFormField = props => {
  return (
    <Grid item xs={12}>
      <TextField
        fullWidth
        {...(props.name === "amount_notes" ? "multiline" : "")}
        rows={props.rows}
        label={props.label}
        type={props.type}
        name={props.name}
        placeholder={props.label}
        value={null}
        onChange={null}
      />
    </Grid>
  );
};
